const express = require('express')
const bodyParser = require ('body-parser') // body parser pozwala na odczytanie body przychodzącego requestu
const cors = require('cors') // cross origin resource sharing
const fs = require('fs')
const path = require('path')
const App = require('../frontend/src/containers/App')
const { sendMail } = require('./controllers/sendmail/sendmail.js')
const { ProductsGet } = require('./controllers/Products/ProductsGet.js')
const React = require('react');
const ReactDOMServer = require('react-dom/server');


const PORT = 3001;
const app = express();
app.use(bodyParser.json())
app.use(cors())

app.use('^/$' , (req, res, next) => {
  fs.readFile(path.resolve('../frontend/build/index.html'), 'UTF-8', (err, data) => {
    if (err) {
      console.log(err)
      return res.status(500).json('some error happened')
    }
    return res.json(data.replace('<div id="root"></div>', `<div id="root">${ReactDOMServer.renderToString(<App />)}</div> `))
  })
})

app.use(express.static(path.resolve(__dirname, '../frontend', 'build')))




app.get('/', (req, res) => {
  res.json('im hereeee')
})

app.post('/mgbs', async (req, res) => {
  const { model } = req.body
  ProductsGet(model, req, res)
})


app.post('/sendmail', (req, res) => sendMail(req, res))

app.listen(PORT , () => {
  console.log(`listenning on ${PORT}`)
})

