                    <input className='mail-input' onChange={handleChange} {...otherProps}/>
                    <label className={`${otherProps.value.length ? 'shrink' : ''} mail-input-label`}>{label}</label>
                </div>
            }
        </div>
    )
}

export default ContactUsForm

